import React from "react";
import headerNavbar from "./HeaderNavbar.module.css"
import {NavLink} from "react-router-dom";

const setActive = ({isActive}) => isActive ? 'active-link' : '';

const HeaderNavbar = (props) => {
    return (
        <ul className={headerNavbar.list}>
            <NavLink to={"/home"} className={headerNavbar.item}>Home</NavLink>
            <NavLink to={"/products"} className={headerNavbar.active}>Products</NavLink>
            <NavLink to={"/chats"} className={headerNavbar.active}>Chats</NavLink>
        </ul>
    )
}

export default HeaderNavbar
